    data: |
      SELECT DISTINCT ( - 51 ) FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q9326.out
    data: |
      -51
